package assignment1;

public class switchcase10 {

	public static void main(String[] args) {
		// TODO Auto-generated method stub

		String value="Selenium";
		
		switch(value)
		
		{
			case "Java":
			{
				System.out.println("value is Java");
				
			}
		break;
		
		     
		
			case "Java-script":
			{
				System.out.println("value is Java-Script");
			}
		break;
		
		
			case "Selenium":
			{
				System.out.println("value is Selenium");
			}
		break;
		
		
			case "Python":
			{
				System.out.println("value is Python");
			}
		break;
		
		
			default:
			{
				System.out.println(" value is Mukesh");
			}
		break;
		
			
				
				
			
		}
		
	}

		
	}


